import React, { useState } from "react";
import { Jumbotron, Container, Image, Alert } from "react-bootstrap";
import styles from "../CSS/Category.module.css";
import { useParams } from "react-router-dom";

export default function Category() {
  const { id } = useParams();

  const [product, setProcuct] = useState({
    "name": "",
    "brand": "",
    "description": "",
    "price": "",
    "img": ""
  })

  return (
    <Jumbotron id="about" className={styles.Jumbotron} fluid>
      <Container>
        <div className={styles.card}>
          <h1 className={styles.heading}>
            <span className={styles.Us}>Category</span>
          </h1>
        </div>
      </Container>
      <div className={styles.lineGrade} ></div>
    </Jumbotron>
  );
}
